// ajax
import axios from 'axios'
const post = (url, data = {}) => {
  return new Promise((resolve, reject) => {
    axios.post(url, data, {
      baseURL: 'https://www.fastmock.site/mock/99ac4a1a05d338aefa4b0f0acc072398/api',
      headers: {
        'content-type': 'application/json'
      }
    }).then((respones) => {
      resolve(respones.data)
    }, (err) => {
      reject(err)
    })
  })
}

export { post }
